import React from "react";
import Slider from "react-slick";

function Carousel() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
        },
      },
    ],
  };

  return (
    <Slider {...settings}>
      <div>
        <img src="http://placekitten.com/300/200" alt="cat1" />
      </div>
      <div>
        <img src="http://placekitten.com/300/201" alt="cat2" />
      </div>
      <div>
        <img src="http://placekitten.com/300/202" alt="cat3" />
      </div>
      <div>
        <img src="http://placekitten.com/300/203" alt="cat4" />
      </div>
    </Slider>
  );
}

export default Carousel;
